import { BrowserRouter, Route, Routes } from "react-router-dom";
import StudentTable from "./StudentsTable.tsx";
import React from "react";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/students" element={<StudentTable />} />
      </Routes>
    </BrowserRouter>
  );
}

export { App };
